Since 1 decagram $=10$ grams, 2 decagrams $=20$ grams. \begin{align*}
20 \; \text{grams} &=20 \times 1000 \; \text{milligrams} \\
&= 20,000 \; \text{milligrams}
\end{align*}Therefore, there are $20\,000$ milligrams in one 2-decagram container, which means there are $\boxed{\textbf{(C) }2,\!000}$ 1-milligram doses in one 2-decagram container.

The probability that the person belongs to Group Y given that he/she recalled at least 1 dream is equal to the fraction of people in Group Y who recalled at least 1 dream divided by the fraction of all people who recalled at least 1 dream. 

Let's first calculate the fraction of people who recalled at least 1 dream, which is:
\begin{align*}
\frac{\text{Total - None}}{\text{Total}} &= \frac{200-36}{200} \\
&= \frac{164}{200}
\end{align*}

Next, let's calculate the fraction of people in Group Y who recalled at least 1 dream, which is:
\begin{align*}
\frac{\text{Group Y (1 to 4) + Group Y (5 or more)}}{\text{Total Y}} &= \frac{11+68}{100}\\
&= \frac{79}{100}
\end{align*}

Therefore, the probability that a person chosen at random from those who recalled at least 1 dream belongs to Group Y is:
\begin{align*}
\frac{\frac{\text{Group Y (1 to 4) + Group Y (5 or more)}}{\text{Total Y}}}{\frac{\text{Total - None}}{\text{Total}}} &= \frac{\frac{79}{100}}{\frac{164}{200}} \\
&= \frac{79}{164}
\end{align*}

Answer: $\boxed{\textbf{(C)}\ \frac{79}{164}}$.
